import React from "react"

const Input = ({ label, name, handleChange, value }) => {
  return (
    <div>
      <label>{label}</label>

      <input
        onChange={(e) => handleChange(e.target.name, e.target.value)}
        name={name}
        value={value}
      ></input>
    </div>
  )
}

export default Input
